// src/components/ProductCard.js
import React from 'react';

const ProductCard = ({ imageUrl, title, category, price, time }) => {
  return (
    <div className="flex border-b border-gray-300 py-2">
      <img className="h-20 w-32 object-cover" src={imageUrl} alt={title} />
      <div className="flex flex-col justify-between ml-4 flex-grow">
        <span className="text-sm text-gray-600">{category}</span>
        <span className="font-bold">{title}</span>
      </div>
      <div className="flex flex-col justify-between items-end">
        <span className="text-sm text-gray-500">{time}</span>
        <span className="text-lg text-red-500">{price}</span>
      </div>
      <button className="ml-4 text-gray-400 hover:text-red-500">
        <i className="far fa-heart"></i> {/* You'll need to include Font Awesome to use this icon */}
      </button>
    </div>
  );
};

export default ProductCard;
